      <EventsList />
      {/* <ul>
        {EVENTS.map((event) => (
          <li key={event.id}>
            <Link to={event.id}>{event.title}</Link>
          </li>
        ))}
      </ul> */}
      <Link to='..' relative="path">Back</Link>
    </>
  );
}
export default Products;
